import { React, useEffect, useState } from "react";
import axios from "axios";

const Kategorije = () => {
  const [data, setData] = useState({});

  useEffect(async () => {
    const result = await axios.get("http://localhost:5000/kategorije/");

    setData(result.data);
  }, []);
  console.log(data);
  return <h1>sranje</h1>;
};

export default Kategorije;
